import { useState } from "react";

const useTest = async () => {
  const [token, setToken] = useState(null);
  const t = await AsyncStorage.getItem("accessToken");
  console.log("t: ", t);
  console.log("hook: ", token);
  setToken(t);

  return { token };
};

export default useTest;
